import React, { Component, Fragment } from 'react';
import './App.css';

class App extends Component {
  foo = () => 'Bars'.toUpperCase();
  render() {
    return (
      <div className='App'>
        <h1>Hello {this.foo()}</h1>
        <h2>Goodbye</h2>
      </div>
    );
  }
}

export default App;
